import React from 'react';
import './Homepage.css'

const Homepage = () => {

  return (
    <div className="homepage">
      <h1 className="company-name">E-Shopping - Electro Mart</h1>
      <p className="description">An e-commerce website specializing in smartphones and laptops.</p>
      <p className="final-line">Explore our wide range of products and find the perfect device for you!</p>
    </div>
  );
}

export default Homepage;
